import React, { Component } from 'react';
import { Route, Link, BrowserRouter as Router } from 'react-router-dom'

import './App.css';

class Header extends Component {

  constructor(props) {
    super(props);
    this.state = {
    }
  }

  render() {

    return (

      <div>
        <ul className="header">

          <Link to="/" className="link"><img id="name" src="https://fontmeme.com/permalink/190107/579de3df23688887f434564027f09280.png" border="0" onMouseOver={this.changeFont} ></img></Link>
          <h4 style={{float: 'right'}} className="sub-heading"><Link to="/music" className="link">Music</Link></h4>
          <h4 style={{float: 'right'}} className="sub-heading">Resume</h4>
          <h4 style={{float: 'right'}} className="sub-heading">Project</h4>
        </ul>




      </div>
    ); 
  }
}

export default Header;
